  methods:{
      filterIdEvent (data) {
        this.baseList.forEach(item=>{
          this.$set(item,'checked',false);
        })
        data.checked = true;
        // this.clearFilterId();//清空已选中
        this.$refs.xGrid.clearFilter(this.$refs.xGrid.getColumnByField('infoKey'))
        const xTable = this.$refs.xGrid,
          column = xTable.getColumnByField('infoKey'),
          arrInfoKey = [];
        dataList.forEach(dataItem=>{
          if(dataItem.baseIds.indexOf(data.baseId)>-1){
            arrInfoKey.push(dataItem.infoKey);
          }
        });
        if(arrInfoKey.length==0){
          column.filters.forEach(item=>{
            if('close' == item.value){
              item.checked = true;
            }
          })
        }else{
          column.filters.forEach(item=>{
            arrInfoKey.forEach(key=>{
              if(key == item.value){
                item.checked = true;
                // item.data = key;
              }
            })
          })
        }
        // 修改条件之后，需要手动调用 updateData 处理表格数据
        xTable.updateData()
        this.$nextTick(() => {
        xTable.recalculate()
        })
      },
      clearFilterId(){
        this.baseList.forEach(item=>{
          item.checked = false;
        })
        this.$refs.xGrid.clearFilter(this.$refs.xGrid.getColumnByField('infoKey'))
      },
      eachDataList(rows,type){
        const keyArr = [];
        this.spuIdObj = {};
        let columnsTop = [],zoneNameIdMap = {},branchNameIdMap = {},lineNameIdMap = {},marketIdMap = {},infoKeyArr = [{label: '暂无',value: 'close'}];
        rows.forEach((item,index)=>{
          if(index == 0){//确定列 以及基地数据
            columnsTop = [
              {
                title: '序号',
                type: 'seq',
                field: 'infoKey',
                fixed: 'left',
                width: '50px',
                filters:[],
                // filterMethod: this.filterMethodInfoKey
              },
              {
                title: '战区',
                field: 'warZoneId',
                fixed: 'left',
                width: '100px',
                formatter:({cellValue,row,column})=>row.zoneName,
                filters:[]
              },
              {
                title: '分部',
                field: 'branchId',
                fixed: 'left',
                width: '105px',
                formatter:({cellValue,row,column})=>row.branchName,
                filters:[]
              },
              {
                title: '线路',
                field: 'lineId',
                fixed: 'left',
                width: '75px',
                formatter:({cellValue,row,column})=>row.lineName,
                filters:[]
              },
              {
                title: '市场',
                field: 'marketId',
                fixed: 'left',
                width: '75px',
                formatter:({cellValue,row,column})=>row.marketName,
                filters:[]
              },
              {
                title: '可发货金额',
                field: 'overage',
                align: 'right',
                fixed: 'left',
                width: '90px',
              }
            ];
            
            //取除散籽列放最后 条放在散籽前面
            const headPound = [],
              capaPound = [],
              headRite = [],
              capaRite = [];
            for(let key in item.header){//配置品名title
              if(item.header[key]){//防止产品返回对象为空报错
                this.spuIdObj[key] = item.header[key].categoryId;//右键查询基地使用 分类Id、
                const headObj = {
                  title: item.header[key].spuName,
                  field: key+'.number',
                  align: 'right',
                  minWidth: '80px',
                  params: key,
                  /*slots:{
                    footer:({column, columnIndex, $columnIndex, _columnIndex, $rowIndex, items})=>{
                      console.log(column, columnIndex, $columnIndex, _columnIndex, $rowIndex, items);
                      if(items[columnIndex].overflowNum>0){
                        return [
                          <div class='fContentZ'>
                            <my-icon type='icon-shangsheng'></my-icon>
                            <span>{items[columnIndex].overflowNum}</span>
                          </div>,
                          <div>{items[columnIndex].num}</div>
                      ]
                      }else{
                        return [
                          <div>{items[columnIndex]}</div>
                      ]
                      }
                    }
                  }*/
                }
                const capaObj = {
                  title: item.header[key].spuName,
                  field: key+'.m1',
                  minWidth: '80px',
                  align: 'right',
                  params: key,
                }
                if(item.header[key].unit == 'pound'){
                  headObj.minWidth = '50px';
                  capaObj.minWidth = '50px';
                  headPound.push(headObj);
                  capaPound.push(capaObj);
                }else if(item.header[key].unit == 'rite'){
                  headRite.push(headObj);
                  capaRite.push(capaObj);
                }else{
                  columnsTop.push(headObj);
                }
                keyArr.push(key);
              }
            }
            columnsTop = columnsTop.concat(headRite,headPound);
            columnsTop.push(
              {
                title: '总计(件)',
                field: 'totalPieces',
                align: 'right',
                // fixed: 'right',
                width: '80px',
              },
              /*{
                title: '总计(斤)',
                field: 'totalPound',
                align: 'right',
                // fixed: 'right',
                width: '60px',
              },
              {
                title: '总计(条)',
                field: 'totalStrip',
                align: 'right',
                // fixed: 'right',
                width: '80px',
              },*/
              {
                title: '信用额度',
                field: 'm7',
                align: 'right',
                fixed: 'right',
                width: '70px',
              },
              {
                title: '订单金额',
                field: 'totalMoney',
                align: 'right',
                fixed: 'right',
                width: '80px',
                slots:{
                  default: 'totalMoneyTemp'
                }
              },
              {
                title: '排单余额(元)',
                field: 'realTimeMoney',
                align: 'right',
                fixed: 'right',
                width: '110px',
                filters:[{label:'余额不足',value:'noAmple'},{label:'余额足',value:'ample'}],
                filterMethod:this.filterMethod
              }
            )
          }
          let totalPieces = 0,totalPound = 0,totalMoney = 0,totalMoneySource = 0,totalStrip = 0,baseIds = []//摘取当前行中所有baseId;
          keyArr.forEach(key=>{
            if(item.header[key]) {//防止base中没有 other产品名称
              if (item.header[key].unit == 'pieces') {
                totalPieces = XEUtils.add(totalPieces, item.header[key].number || 0);
              } else if(item.header[key].unit == 'pound') {
                totalPound = XEUtils.add(totalPound, item.header[key].number || 0);
              }else{
                totalStrip = XEUtils.add(totalStrip, item.header[key].number || 0);
              }
              //没有数量证明没有基地
              if(item.header[key].number){
                if(!this.baseSelectSpuTotal[item.header[key].baseId]){
                  this.baseSelectSpuTotal[item.header[key].baseId] = {};//创建基地存放品名骨架
                }
                //计算当前基地下 已选品名 各个数量合计
                if(this.baseSelectSpuTotal[item.header[key].baseId][key]){
                  this.baseSelectSpuTotal[item.header[key].baseId][key].number = XEUtils.add(this.baseSelectSpuTotal[item.header[key].baseId][key].number,item.header[key].number);
                }else{
                  this.baseSelectSpuTotal[item.header[key].baseId][key] = {
                    number: item.header[key].number,
                    spuName: item.header[key].spuName
                  };
                }
                totalMoney = XEUtils.add(totalMoney,item.header[key].totalPrice || 0);//订单金额
                totalMoneySource = XEUtils.add(totalMoneySource,item.header[key].totalAmount || 0);//原始订单金额
                baseIds.push(item.header[key].baseId);
              }
            }
          })
          item.totalPieces = totalPieces;
          item.totalPound = totalPound;
          item.totalStrip = totalStrip;
          item.totalMoney = totalMoney;
          item.totalMoneySource = totalMoneySource;
          //从缓存取数据 不需要在加一遍 m2
          if(!type){
            item.overage = XEUtils.add(item.overage,item.m2);//总余额等于 可用余额+冻结金额
            // item.totalNum = XEUtils.add(XEUtils.add(item.overage,item.m7),totalMoneySource);//可用等于可用余额+信用金额+原始订单金额
          }
          item.totalNum = XEUtils.add(item.overage,item.m7);//总可用等于总余额+信用金额
          item.realTimeMoney = XEUtils.subtract(item.totalNum,totalMoney);
          item.baseIds = baseIds.toString();
          infoKeyArr.push({
            label: '暂无',
            value: item.infoKey
          })
          /*let objItem = {
           /!* ...item.header,*!/
          }*/
          for (let key in item.header){
            item[key] = item.header[key];
          }
          // Object.assign(objItem,item);
          zoneNameIdMap[item.warZoneId] = {label:item.zoneName,value: item.warZoneId};
          branchNameIdMap[item.branchId] = {label:item.branchName,value: item.branchId};
          lineNameIdMap[item.lineId] = {label:item.lineName,value: item.lineId};
          marketIdMap[item.marketId] = {label:item.marketName,value: item.marketId};
          // if(item.lineName == '莞西线'){
          //     console.log(index,'index')
              dataList.push(item);
          // }
        })
        
        console.log(this.baseSelectSpuTotal,'baseSelectSpuTotal');
        this.$nextTick(function () {
          const xGrid = this.$refs.xGrid;
          Promise.all([
            xGrid.reloadColumn([]),
            xGrid.reloadData([]),
            xGrid.reloadColumn(columnsTop),
            xGrid.reloadData(dataList)
          ]).then(() => {
            this.warZoneIdList = Object.values(zoneNameIdMap);
            this.branchIdList = Object.values(branchNameIdMap);
            this.lineIdList = Object.values(lineNameIdMap);
            this.marketIdList = Object.values(marketIdMap);
            xGrid.setFilter('infoKey',infoKeyArr);
            xGrid.setFilter('warZoneId',this.warZoneIdList);
            xGrid.setFilter('branchId',this.branchIdList);
            xGrid.setFilter('lineId',this.lineIdList);
            xGrid.setFilter('marketId',this.marketIdList);
            xGrid.updateData();
            xGrid.hideColumn('warZoneId');
            this.loading = false;
          })
        });
        
      },
