        //       /*data.forEach(item=>{
        //         if(item[column.property]){
        //           num = calculationMethod(num,item[column.params].number||0,'add');
        //         }
        //       })*/
        //       means.push(num);
        //     }else{
        //       means.push('-')
        //     }
        //   }
        // })
        // 返回一个二维数组的表尾合计
        return [[11,22,33]]
      },
      footerRowspanMethod ({ _rowIndex, _columnIndex }) {//表尾合并方法
        if (_rowIndex === 0) {
          if (_columnIndex === 0) {
            return { rowspan: 1, colspan: 4,align: 'center'}
          }else if(_columnIndex === 1){
            return { rowspan: 0, colspan: 0 }
          }else if(_columnIndex === 2){
            return { rowspan: 0, colspan: 0 }
          }else if(_columnIndex === 3){
            return { rowspan: 0, colspan: 0 }
          }/*else if(_columnIndex === 4){
            return { rowspan: 0, colspan: 0 }
          }*/
        }
      },
      footerCellClassName ({ $rowIndex, column, columnIndex, $columnIndex,data }) {//表尾增加class
        // if(column.params && this.dataListTable[0]){
        //   if(data[0][columnIndex] > this.dataListTable[0][column.params].m1){
        //     return 'col-red2'
        //   }
        // }
      },
      cellClassName({ row, rowIndex, $rowIndex, column, columnIndex, $columnIndex }){
        if(column.property == 'realTimeMoney'){
          // let total = this.countTotalNum(row,'totalMoney');
          // if(total>row.userMoney){
          if(row.totalMoney>row.totalNum){//订单金额 大于可用余额+信用金额
            return 'col-red';
          }
        }else {
          const strKey = row.infoKey + '-' + columnIndex;
          // const keys = column.property.split('.')
          let classStr = '';
          if (this.selectMap[strKey]) {
            classStr = 'cell-click-active';
          }
          if(this.changeCellObj[strKey] == true){
            classStr = classStr&&(classStr+' changeCellClass')||'changeCellClass';
          }
          return classStr;
        }
      },
      cellStyle({ row, rowIndex, $rowIndex, column, columnIndex, $columnIndex }){
        const strKey = row.infoKey + '-' + columnIndex;
        if (!this.selectMap[strKey]&&
          column.params&&
          row[column.params]&&
          row[column.params].number&&
          row[column.params].number != 0&&//数量为0是  不允许分配基地
          this.baseMapColor) {
          // console.log(row[column.params],this.baseMapColor,row[column.params].baseId,this.baseMapColor[row[column.params].baseId],'row[column.params]')
          return {background: this.baseMapColor[row[column.params].baseId]||'',color: this.baseMapColor[row[column.params].baseId]?'#000000':'inherit'};
        }
      },
      rowClassName({ row, rowIndex, $rowIndex }){
        if(this.rowSelectmap[rowIndex]){
          return 'row-click-active';
        }else{
          return '';
        }
      },
  }
}
